		g_VGuiSurface->DrawOutlinedRect(bbox.left, bbox.bottom, bbox.right, bbox.top);
		g_VGuiSurface->DrawSetColor(Color::Outline);
		g_VGuiSurface->DrawOutlinedRect(bbox.left - 1, bbox.bottom - 1, bbox.right + 1, bbox.top + 1);
		g_VGuiSurface->DrawOutlinedRect(bbox.left + 1, bbox.bottom + 1, bbox.right - 1, bbox.top - 1);
